import { useState, useEffect } from 'react';
import { Outlet, Link } from "react-router-dom";
import Block from './profileblock';
import { NavLink } from "react-router-dom";


function Main() {
  const [topic, setTopic] = useState('all')
  const [stories, setStories] = useState([]);

  // This method fetches the stories from the database.
 useEffect(() => {
   async function getStories() {
     const response = await fetch(`http://localhost:5000/stories/`);
      if (!response.ok) {
       const message = `An error occurred: ${response.statusText}`;
       window.alert(message);
       return;
     }
    const records = await response.json();
     setStories(records);
   }
    getStories();;
    return;
 }, [stories.length]);


  const col1 = [];
  const col2 = [];
  const col3 = [];
  let val = 0;

  for (let i = 0; i < stories.length; i++) {
    if (topic == 'all') {
      if (i%3 == 0) {
        col1.push(<Block genre = {stories[i].genre} text = {stories[i].text} img = {stories[i].img}/>);
      } else if (i%3 == 1) {
        col2.push(<Block genre = {stories[i].genre} text = {stories[i].text} img = {stories[i].img}/>);
      } else {
        col3.push(<Block genre = {stories[i].genre} text = {stories[i].text} img = {stories[i].img}/>);
      }
    } else {
      if (stories[i].genre.includes(topic)) {
        if (val%3 == 0) {
          col1.push(<Block genre = {stories[i].genre} text = {stories[i].text} img = {stories[i].img}/>);
        } else if (val%3 == 1) {
          col2.push(<Block genre = {stories[i].genre} text = {stories[i].text} img = {stories[i].img}/>);
        } else {
          col3.push(<Block genre = {stories[i].genre} text = {stories[i].text} img = {stories[i].img}/>);
        }
        val++;
      }
    }
  }


  return (
    <div className="container">
      <div className='header'>
        <NavLink to={'/'} className='linkstyle'>
        <p className='headline'>Stories From Home</p>
        </NavLink>
        <NavLink className="linkstyle" to="/create">
          <button className="button1 storybutton">SHARE STORY</button>
             </NavLink>
        <Link to={'/create'} className='linkstyle'>
        <button className='button1 storybutton'>BROWSE THE ARCHIVE</button>
        </Link>
        </div>
        <div className='topic-container'>
          <hr></hr>
          <div>
            {JSON.stringify(stories)}
          </div>
          <button className = {`topic ${topic == 'all' ? 'selected': ''}`} onClick={() => setTopic('all')}>ALL</button>
          <button className = {`topic ${topic == 'immigration' ? 'selected': ''}`} onClick={() => setTopic('immigration')}>IMMIGRATION</button>
          <button className = {`topic ${topic == 'love' ? 'selected': ''}`} onClick={() => setTopic('love')}>LOVE&KINDNESS</button>
          <button className = {`topic ${topic == 'friend' ? 'selected': ''}`} onClick={() => setTopic('friend')}>FRIENDSHIP</button>
          <button className = {`topic ${topic == 'family' ? 'selected': ''}`} onClick={() => setTopic('family')}>FAMILY</button>          
          <button className = {`topic ${topic == 'loss' ? 'selected': ''}`} onClick={() => setTopic('loss')}>LOSS</button>
          <button className = {`topic ${topic == 'grow' ? 'selected': ''}`} onClick={() => setTopic('grow')}>GROWING</button>
          <button className = {`topic ${topic == 'career' ? 'selected': ''}`} onClick={() => setTopic('career')}>CAREERS&PASSIONS</button>
          <button className = {`topic ${topic == 'faith' ? 'selected': ''}`} onClick={() => setTopic('faith')}>FAITH</button>
          <hr></hr>
        </div>
        <div className='photo-board'>
          <div className='col'>
            {col1}
          </div>
          <div className='col'>
            {col2}
          </div>
          <div className='col'>
            {col3}
          </div>
        </div>


    </div>
  );
}

export default Main;
